import React from "react";
import {Button} from 'antd';

const GeoCoordinate = ({coordinate, id, removeItem}) => {

    const removeEmployee = () => {
        removeItem(id)
    }

    const options = {
        era: 'long',
        year: 'numeric',
        month: 'long',
        day: 'numeric',
        weekday: 'long',
        timezone: 'UTC',
        hour: 'numeric',
        minute: 'numeric',
        second: 'numeric'
    };

    return <div>
        <div>
            {
                id !== 1 &&
                <span>
                            <div>Latitude: {coordinate.latitude}</div>
                            <div>Longitude: {coordinate.longitude}</div>
                            <div>Address: {coordinate.address}</div>
                            <div>Date: {coordinate.date.toLocaleString("en", options)}</div>
                            <Button danger onClick={removeEmployee}>Delete</Button>
                        </span>
            }

        </div>
    </div>
}

export default GeoCoordinate;
